import React from 'react';

function Transaction({ transactions }) {
  return (
    <React.Fragment>
      {transactions.map((trans) => (
        <tr key={trans.id}>
          <td>
            <h3>{trans.date}</h3>
          </td>
          <td>
            <h3>{trans.description}</h3>
          </td>
          <td>
            <h3>{trans.category}</h3>
          </td>
          <td>
            <h3>{trans.amount}</h3>
          </td>
        </tr>
      ))}
    </React.Fragment>
  );
}

export default Transaction;
